# One liner code for taking 4 numbers as input from keyboardx, y, z, n = (int(input()) for _ in range(4))# find 2nd highest in a sorted list of numbers containing repeating numbersnums = [1,1,1,2,2,2,2,2,2,3,4,4,5]#method 1: starting with index 1 compare with previous elementfor i in range(1,len(nums)):    if nums[i]!=nums[i-1]:        second_highest = nums[i]        breakprint(second_highest)#method 2: starting with index 0 compare with next elementfor i in range(len(nums)-1):    if nums[i]!=nums[i+1]:        second_highest = nums[i+1]        breakprint(second_highest)# find all occurences of 2nd highest appearing in a sorted list of numbers  containing repeating numbersnums = [1,1,1,2,2,2,2,2,2,3,4,4,5]res=[]found=Falsefor i in range(1,len(nums)):    if nums[i]!=nums[i-1] and not found:        second_highest = nums[i]        found=True    if found and nums[i]==second_highest:        res.append(nums[i])print(res)